    const provinciasDistritos = {"CHINCHA": ["ALTO LARAN", "CHAVIN", "CHINCHA ALTA", "CHINCHA BAJA", "EL CARMEN", "GROCIO PRADO", "PUEBLO NUEVO", "SAN JUAN DE YANAC", "SAN PEDRO DE HUACARPANA", "SUNAMPE", "TAMBO DE MORA"], "ICA": ["ICA", "LA TINGUI\u00d1A", "LOS AQUIJES", "OCUCAJE", "PACHACUTEC", "PARCONA", "PUEBLO NUEVO", "SALAS", "SAN JOSE DE LOS MOLINOS", "SAN JUAN BAUTISTA", "SANTIAGO", "SUBTANJALLA", "TATE", "YAUCA DEL ROSARIO"], "NASCA": ["CHANGUILLO", "EL INGENIO", "MARCONA", "NASCA", "VISTA ALEGRE"], "PALPA": ["LLIPATA", "PALPA", "RIO GRANDE", "SANTA CRUZ", "TIBILLO"], "PISCO": ["HUANCANO", "HUMAY", "INDEPENDENCIA", "PARACAS", "PISCO", "SAN ANDRES", "SAN CLEMENTE", "TUPAC AMARU INCA"]};

    const colors = ["#e41a1c","#377eb8","#4daf4a","#984ea3","#ff7f00","#ffff33","#a65628","#f781bf","#999999"];
    const colorMap = {};
    let colorIndex = 0;
    function getColor(nombre) {
      if (!colorMap[nombre]) {
        colorMap[nombre] = colors[colorIndex % colors.length];
        colorIndex++;
      }
      return colorMap[nombre];
    }

    let currentLayer;

    function updateMap(provincia, distrito) {
      if (currentLayer) {
        map.removeLayer(currentLayer);
      }
      colorIndex = 0;
      currentLayer = L.geoJSON(geojsonData, {
        filter: function(feature) {
          const prov = feature.properties.PROVINCIA;
          const dist = feature.properties.DISTRITO;
          return (!provincia || prov === provincia) && (!distrito || dist === distrito);
        },
        style: function(feature) {
          return {
            fillColor: getColor(feature.properties.DISTRITO),
            weight: 1,
            color: "#555",
            fillOpacity: 0.6
          };
        },
        onEachFeature: function(feature, layer) {
          layer.bindTooltip(feature.properties.DISTRITO, {
            permanent: true,
            direction: "center",
            className: "district-label"
          });
        }
      }).addTo(map);
      if (currentLayer.getBounds().isValid()) {
        map.fitBounds(currentLayer.getBounds());
      }
    }

    const provinciaSelect = document.getElementById("provincia");
    const distritoSelect = document.getElementById("distrito");

    // Llenar provincias
    for (const prov in provinciasDistritos) {
      const option = document.createElement("option");
      option.value = prov;
      option.textContent = prov;
      provinciaSelect.appendChild(option);
    }

    provinciaSelect.addEventListener("change", () => {
      const provincia = provinciaSelect.value;
      distritoSelect.innerHTML = '<option value="">-- Todos los distritos --</option>';
      distritoSelect.disabled = !provincia;
      if (provincia) {
        provinciasDistritos[provincia].forEach(d => {
          const opt = document.createElement("option");
          opt.value = d;
          opt.textContent = d;
          distritoSelect.appendChild(opt);
        });
      }
      updateMap(provincia, "");
    });

    updateMap("", "");

distritoSelect.addEventListener("change", () => {
      updateMap(provinciaSelect.value, distritoSelect.value);
    });
